import React, { Component } from 'react';

class Application extends Component {
        constructor(props) {
          super(props);
          this.state = {

          };

          this.handleInputChange = this.handleInputChange.bind(this);
        }

        handleInputChange(event) {
          const target = event.target;
          const value = target.type === 'checkbox' ? target.checked : target.value;
          const name = target.name;

          this.setState({
            [name]: value
          });
          console.log(event.target.parent)
        }
    // handleResChange = (e) => {
    //     let index = e.target.selectedIndex;
    //     let element = e.target[index];
    //     this.setState({ element: element});
    //     this.setState({ permResident: element.label});
    // }
    // handleAuthChange = (e) => {
    //     let index = e.target.selectedIndex;
    //     let element = e.target[index];
    //     this.setState({ element: element});
    //     this.setState({ authToWork: element.label});
    // }
    // handleGIChange = (e) => {
    //     let index = e.target.selectedIndex;
    //     let element = e.target[index];
    //     this.setState({ element: element});
    //     this.setState({ GIBill: element.label});
    // }
    // handleVETTECChange = (e) => {
    //     let index = e.target.selectedIndex;
    //     let element = e.target[index];
    //     this.setState({ element: element});
    //     this.setState({ VETTEC: element.label});
    // }
    // handleCodingXPChange = (e) => {
    //     let index = e.target.selectedIndex;
    //     let element = e.target[index];
    //     this.setState({ element: element});
    //     this.setState({ codingXP: element.label});
    // }
    // handleIntentionsChange = (e) => {
    //     let index = e.target.selectedIndex;
    //     let element = e.target[index];
    //     this.setState({ element: element});
    //     this.setState({ intentions: element.label});
    // }
    // handleSubmit(event) {
    //     event.preventDefault();
    //     // let exportData = this.state
    //     // fire.database().ref('messages').push( exportData );
    //     this.setState({}); // <- clear the input
    // }
    render() {
        return (
                <div style={{margin:"100px"}}>
                    <form className="manualContainer" onSubmit={(e) => this.handleSubmit(e)}>
                        <label>First Name</label>
                        <input required onChange={this.handleInputChange} placeholder="First Name" /><br/>
                        <label>Last Name</label>
                        <input required onChange={this.handleInputChange} placeholder="Last Name" /><br/>
                        <label>Email</label>
                        <input required input onChange={this.handleInputChange} type="email" placeholder="Enter Email" /><br/>
                        <label>Phone</label>
                        <input required onChange={this.handleInputChange} placeholder="Enter Phone Number" /><br/>
                        <label>Address</label>
                        <input required onChange={this.handleInputChange} placeholder="1234 Main St" /><br/>
                        <label>Address 2</label>
                        <input onChange={this.handleInputChange}placeholder="Apartment, studio, or floor" /><br/>
                        <label>City</label>
                        <input required onChange={this.handleInputChange} placeholder="New York City"/><br/>

                        <label>State</label>
                        <input required onChange={this.handleInputChange} placeholder="New York"/><br/>

                        <label>Zip</label>
                        <input required onChange={this.handleInputChange}placeholder="10001"/><br/>
                        <label>Online Profile 1</label>
                        <input onChange={this.handleInputChange} placeholder="Ex: LinkedIn"/><br/>

                        <label>Online Profile 2</label>
                        <input onChange={this.handleInputChange} placeholder="Ex: GitHub"/><br/>

                        <label>Online Profile 3</label>
                        <input onChange={this.handleInputChange} placeholder="Ex: Portfolio"/><br/>
                        <label>Short Bio</label>
                        <label>How did you hear about our program?</label><br/>
                        <select required onChange={this.handleInputChange}as="select">
                            <placeholder>Select</placeholder><br/>
                            <option>LinkedIn</option><br/>
                            <option>Facebook</option><br/>
                            <option>Google</option><br/>
                            <option>Twitter</option><br/>
                            <option>Facebook</option><br/>
                            <option>Veterans Affaris</option><br/>
                            <option>Operation Code</option><br/>
                            <option>Hiring Heroes</option><br/>
                            <option>IVMF</option><br/>
                            <option>Friend/Family</option><br/>
                            <option>Warrior Scholar</option><br/>
                            <option>Course Report</option><br/>
                            <option>GirHub</option><br/>
                            <option>Reddit</option><br/>
                            <option>Article</option><br/>
                            <option>Other</option><br/>
                        </select><br/>
                        <label>Which cohort are you applying to?</label><br/>
                        <select required as="select" >
                            <option aria-label="option 0" label="Select"></option><br/>
                            <option onChange={this.handleInputChange} aria-label="option 1" label="March 2 - August 7 2019"/> 
                            <option onChange={this.handleInputChange} aria-label="option 2" label="September 1 - February 26 2019"/>  
                        </select><br/>
                        <label>How would you like to attend?</label><br/>
                            <option onChange={this.handleInputChange} aria-label="option 1" label="Virtual"/> 
                            <option onChange={this.handleInputChange} aria-label="option 2" label="In-Person (Syosset, NY)"/> 
                        <label>What is your highest education level?</label><br/>
                        <select required onChange={this.handleInputChange} as="select">
                            <option>High School</option><br/>
                            <option>Associate Degree</option><br/>
                            <option>Bacherlors Degree</option><br/>
                            <option>Masters</option><br/>
                            <option>Doctorate</option><br/>
                        </select><br/>
                        <label>List any other education not included above:</label><br/>
                        <input onChange={(event) => {this.setState({eduNotIncluded: event.target.value})}} placeholder="Certifications, self-learning, etc.."/><br/>
                        <label>Which of the following do you identify with (select all that apply)?<br/>
                            <label>Caucasian
                                <input
                                    name="Caucasian" type="checkbox" checked={this.state.isGoing} onChange={this.handleInputChange}/>
                            </label><br/>
                            <label>African American
                                <input
                                    name="AfricanAmerican" type="checkbox" checked={this.state.isGoing} onChange={this.handleInputChange}/>
                            </label><br/>
                            <label>Hispanic or Latin Origin
                                <input
                                    name="HispanicOrLatinOrigin" type="checkbox" checked={this.state.isGoing} onChange={this.handleInputChange}/>
                            </label><br/>
